import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { lighten, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';
import TableSortLabel from '@material-ui/core/TableSortLabel';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import Checkbox from '@material-ui/core/Checkbox';
import IconButton from '@material-ui/core/IconButton';
import Tooltip from '@material-ui/core/Tooltip';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Switch from '@material-ui/core/Switch';
import DeleteIcon from '@material-ui/icons/Delete';
import FilterListIcon from '@material-ui/icons/FilterList';

function CreateInventory(name, amount)
{
    return 
    {
        name, amount
    }
}

const rows = [
    CreateInventory('XX Bicycles', 4),
    CreateInventory('YY Bicycles', 10),
    CreateInventory('ZZ Bicycles', 2)
];

function descending(a, b, orderBy)
{
    if(b[orderBy] < a[orderBy])
    {
        return -1;
    }
    if(b[orderBy] > a[orderBy])
    {
        return 1
    }
    return 0;
}

function getCompare(order, orderBy)
{
    return order === 'desc' 
        ? (a, b) => descending(a, b, orderBy)
        : (a, b) => -descending(a, b, orderBy);
}

const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});

export default function DenseTable() {
    const classes = useStyles();

    return (
        <TableContainer component={Paper}>
        <Table 
            className=
            {
                classes.table
            } 
            size="small" 
            aria-label="a dense table"
        >
            <TableHead>
                <TableRow>
                    <TableCell>
                        Bicycle Type
                    </TableCell>
                    <TableCell 
                        align="right"
                    >
                        Amount
                    </TableCell>
                </TableRow>
            </TableHead>
        <TableBody>
        {
            rows.map(
                (row) => (
                    <TableRow 
                        key=
                        {
                            row.name
                        }
                    >
                        <TableCell 
                            component="th" 
                            scope="row"
                        >
                        {
                            row.name
                        }
                        </TableCell>
              <TableCell align="right">{row.name}</TableCell>
              <TableCell align="right">{row.amount}</TableCell>

            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
